import "./App.css";

function App() {
  return <div className="App">
    <BrowserRouter>
      <Switch>
          <Route path="/login" >
             <Login />
          </Route>
             <Main />
      </Switch>
    </BrowserRouter>
  </div>;
}

export default App;
